import React from "react";
import Options from "./Options";
import { PageHeader } from "antd";

export default (props: { setType: Function; setName: Function }) => {
  const { setType, setName } = props;
  return (
    <PageHeader
      title="My Pokedex"
      ghost={false}
      extra={
        <Options
          setType={(type: string) => setType(type)}
          setName={(name: string) => setName(name)}></Options>
      }></PageHeader>
  );
};
